import React, { useState } from 'react';
import '../App.css';
import data from '../india.min.geo.json';
import GeoChart from '../components/GeoChart';
import { Carousel, Col, Container, Figure, Row } from 'react-bootstrap';

function MapPage() {
  const [property, setProperty] = useState('');

  return (
    <React.Fragment>
      <Container className='main-container' fluid>
        <Row style={{ height: '90%' }}>
          {/* col-left */}
          <Col>
            <Row>
              <Col>
                <Figure>
                  <Figure.Image
                    width={300}
                    height={300}
                    alt='300x300'
                    src='https://i.pinimg.com/originals/64/a5/92/64a5923a87f1a724a0b2f5ea1535dcab.png'
                  />
                </Figure>
              </Col>
            </Row>
            <Row>
              <Col>
                <Figure>
                  <Figure.Image
                    width={300}
                    height={300}
                    alt='300x300'
                    src='https://i.pinimg.com/originals/64/a5/92/64a5923a87f1a724a0b2f5ea1535dcab.png'
                  />
                </Figure>
              </Col>
            </Row>
          </Col>

          {/* col-middle */}
          <Col
            xs
            lg={6}
            style={{
              display: 'flex',
              justifyContent: 'center',
            }}
          >
            <Carousel style={{ width: '100%', height: '100%' }}>
              <Carousel.Item
                style={{ width: '100%', height: '100%' }}
                className='d-block w-100'
              >
                <GeoChart data={data} />
              </Carousel.Item>
              <Carousel.Item style={{ width: '100%', height: '100%' }}>
                hello
              </Carousel.Item>
              <Carousel.Item style={{ width: '100%', height: '100%' }}>
                hello
              </Carousel.Item>
            </Carousel>
          </Col>

          {/* col-right */}
          <Col>
            <Row>
              <Col>
                {' '}
                <Figure>
                  <Figure.Image
                    width={300}
                    height={300}
                    alt='300x300'
                    src='https://i.pinimg.com/originals/64/a5/92/64a5923a87f1a724a0b2f5ea1535dcab.png'
                  />
                </Figure>
              </Col>
            </Row>
            <Row>
              <Col>
                {' '}
                <Figure>
                  <Figure.Image
                    width={300}
                    height={300}
                    alt='300x300'
                    src='https://i.pinimg.com/originals/64/a5/92/64a5923a87f1a724a0b2f5ea1535dcab.png'
                  />
                </Figure>
              </Col>
            </Row>
          </Col>
        </Row>
      </Container>
      {/* <h2>India Map with d3-geo</h2>
      <GeoChart data={data} property={property} /> */}
      {/* <h2>Select property to highlight</h2>
      <select
        value={property}
        onChange={(event) => setProperty(event.target.value)}
      >
        <option value='pop_est'>Population</option>
        <option value='name_len'>Name length</option>
        <option value='gdp_md_est'>GDP</option>
      </select> */}
      {/* <Video /> */}
    </React.Fragment>
  );
}

export default MapPage;
